import React from 'react';
import { useActionState } from 'react';

async function increment(previousState: number, formData: FormData) {
  return previousState + 1;
}

async function decrement(previousState: number, formData: FormData) {
  return previousState - 1;
}

async function reset(previousState: number, formData: FormData) {
  return 0;
}

export function CounterApp() {
  const [state, formAction] = useActionState(increment, 0);

  const handleDecrement = () => {
    formAction(decrement);
  };

  const handleReset = () => {
    formAction(reset);
  };

  return (
    <div>
      <p>Count: {state}</p>
      <form>
        <button type="button" onClick={() => formAction(increment)}>Increment</button>
        <button type="button" onClick={handleDecrement}>Decrement</button>
        <button type="button" onClick={handleReset}>Reset</button>
      </form>
    </div>
  );
}
